from builtins import sorted
import sys

from Tools import SequenceUtils


def do_string_composition(k, seq):
    result = []
    for s in SequenceUtils.each_kmer(seq, k):
        result.append(s)

    return sorted(result)


def main(argv=None):
    """
    :param argv: the command line args
    :return: nothing
    """
    if argv is None:
        argv = sys.argv

    k = 100
    seq = ""

    result = do_string_composition(k, seq)

    print ("\n".join(result))


if __name__ == "__main__":
    sys.exit(main())